  export function CreateCustomerDictionary(): TS.Collections.Dictionary<string, TS.Collections.List<TS.Collections.KeyValuePair<string, string>>>
  {
    let resultDict: TS.Collections.Dictionary<string, TS.Collections.List<TS.Collections.KeyValuePair<string, string>>>;

    resultDict = new TS.Collections.Dictionary<string, TS.Collections.List<TS.Collections.KeyValuePair<string, string>>>();

    let parseResult = defaultJSONParser(CustomerDictJSONString);

    for (let key in parseResult)
    {
      let colList: TS.Collections.List<TS.Collections.KeyValuePair<string, string>> = new TS.Collections.List<TS.Collections.KeyValuePair<string, string>>(true);
      for (let item of parseResult[key])
      {
        colList.add(new TS.Collections.KeyValuePair<string, string>(item.Key, item.Value));
      }
      resultDict.add(key, colList);
    }
    return resultDict;
  }

