  /**
  *  @description Creates and returns an array containing
  *               as much random number as defined in 
  *               argument 'number'.
  *               The numbers are positive integers in the
  *               range of [0..numbers].
  * @returns {Array<number>}
  */
  export function CreateRandomNumberArray(numbers: number): Array<number>
  {
    let index: number;
    let resultArr: Array<number>;

    resultArr = new Array<number>();

    for (index = 0; index < numbers; index++)
    {
      resultArr.push(Math.floor(Math.random() * numbers));
    }//END for;

    return resultArr;
  }

