  /**
  * @description A JSON parser which uses a simple reviver function to handle boolean, numbers, null, date and HTMLEncoded strings.
  *
  * @param {string} jsonString
  *
  * @returns {any}, the resulting javascript object.
  *
  * @throws {Error}, Any error which may arise during conversation.
  */
  function defaultJSONParser(jsonString: string): any
  {

    return JSON.parse(jsonString, reviver);

    function decodeHTML(stringValue: string)
    {
      return stringValue.replace(/&#(\d+);/g, function (match, dec)
      {
        return String.fromCharCode(dec);
      });
    }


    function reviver(key: any, value: any): any
    {

      if (typeof (key) == "undefined" || key === null)
      {
        return value;
      }//END if

      if (value === "null")
      {
        return null;
      }//END if

      if (value == "true")
      {
        return true;
      }//END if

      if (value === "false")
      {
        return false;
      }//END if

      if (!isNaN(Number(value)))
      {
        return Number(value);
      }//END if

      if (!isNaN(new Date(value).valueOf()))
      {
        return new Date(value);
      }

      if (typeof (value) == "string")
      {
        return decodeHTML(value);
      }//END if

      return value;
    }

  }

